import base64
import logging
import os
import sys
import threading
import time

import cv2
import numpy as np
import pyautogui
from flask import Flask, request
from PyQt5 import QtCore
from PyQt5.QtCore import (QByteArray, QEasingCurve, QPoint, QPropertyAnimation,
                          QSequentialAnimationGroup, pyqtSignal)
from PyQt5.QtGui import QIcon, QPixmap
from PyQt5.QtWidgets import (QAction, QApplication, QLabel, QMenu,
                             QSystemTrayIcon, QWidget)

EXPRUNE_IMAGE = ''''''

STACK_IMAGE = ''''''

DOTA_IMAGE = ''''''

TEMPLATE_IMAGE = ''''''


def decode_base64_to_numpy(base64_string: str):
    """Decode Base64 string to a NumPy array for OpenCV."""
    image_data = base64.b64decode(base64_string)
    np_array = np.frombuffer(image_data, dtype=np.uint8)
    return cv2.imdecode(np_array, cv2.IMREAD_GRAYSCALE)


# Preload TEMPLATE_IMAGE as a NumPy array for template matching
template = decode_base64_to_numpy(TEMPLATE_IMAGE)


def capture_screen(region=None):
    screenshot = pyautogui.screenshot(region=region)
    screen = cv2.cvtColor(np.array(screenshot), cv2.COLOR_RGB2BGR)
    return screen


def find_template_on_screen(threshold=0.8):
    screen = capture_screen(region=(135, 950, 130, 90))
    screen_gray = cv2.cvtColor(screen, cv2.COLOR_BGR2GRAY)
    res = cv2.matchTemplate(screen_gray, template, cv2.TM_CCOEFF_NORMED)
    loc = np.where(res >= threshold)

    if loc[0].size:
        return True
    return False


def addToClipBoard(text):
    command = 'echo ' + text.strip() + '| clip'
    os.system(command)


class TrayApp(QSystemTrayIcon):
    def __init__(self, overlay_widget, server, app):
        # Decode DOTA_IMAGE to a QPixmap and use it for the tray icon
        dota_pixmap = overlay_widget.decode_base64_to_pixmap(DOTA_IMAGE)
        dota_icon = QIcon(dota_pixmap)

        super().__init__(dota_icon, app)

        self.overlay_widget = overlay_widget
        self.server = server

        # Create the tray menu
        self.menu = QMenu()

        self.exit_action = QAction("Exit", self)
        self.exit_action.triggered.connect(self.quit_application)
        self.menu.addAction(self.exit_action)

        self.setContextMenu(self.menu)
        self.setToolTip("Dota 2 Timer Overlay")
        self.show()

    def quit_application(self):
        """Handle application exit."""
        # Gracefully stop server threads
        self.server.stop()

        # Quit the QApplication loop
        QApplication.quit()


class Overlay_pulse(QWidget):
    signal_start_animation = pyqtSignal()
    signal_update_image = pyqtSignal(str)

    def __init__(self):
        super().__init__()
        self.setWindowIcon(QIcon(self.decode_base64_to_pixmap(DOTA_IMAGE)))

        # Set flags so the window is on top but doesn't accept input or focus
        self.setWindowFlags(QtCore.Qt.WindowStaysOnTopHint |
                            QtCore.Qt.FramelessWindowHint |
                            QtCore.Qt.WindowTransparentForInput)
        # If the above flag isn't available or doesn't behave as expected,
        # use this attribute to ignore mouse events:
        # self.setAttribute(QtCore.Qt.WA_TransparentForMouseEvents, True)

        self.setAttribute(QtCore.Qt.WA_TranslucentBackground)

        self.image_label = QLabel(self)
        self.setFixedSize(400, 400)

        # Center on screen
        screen_center = QApplication.desktop().screen().rect().center()
        self.move(screen_center - QPoint(self.width() // 2, self.height() // 2))

        # Cache your images here...
        self.image_cache = {
            "EXPRUNE_IMAGE": self.decode_base64_to_pixmap(EXPRUNE_IMAGE),
            "STACK_IMAGE": self.decode_base64_to_pixmap(STACK_IMAGE),
        }

        # Animation setup
        self.animation_group = QSequentialAnimationGroup()
        self.fade_in_animation = QPropertyAnimation(self, b'windowOpacity')
        self.fade_in_animation.setDuration(900)
        self.fade_in_animation.setStartValue(0)
        self.fade_in_animation.setEndValue(1)

        self.fade_out_animation = QPropertyAnimation(self, b'windowOpacity')
        self.fade_out_animation.setDuration(1300)
        self.fade_out_animation.setStartValue(1)
        self.fade_out_animation.setEndValue(0)

        self.animation_group.addAnimation(self.fade_in_animation)
        self.animation_group.addAnimation(self.fade_out_animation)
        self.animation_group.finished.connect(self.hide_after_animation)

        self.hide()

        # Connect signals
        self.signal_start_animation.connect(self.start_animation)
        self.signal_update_image.connect(self.set_image)

    def decode_base64_to_pixmap(self, base64_string: str):
        pixmap = QPixmap()
        pixmap.loadFromData(QByteArray.fromBase64(
            base64_string.encode("utf-8")))
        return pixmap

    def set_image(self, image_key: str):
        pixmap = self.image_cache.get(image_key)
        if pixmap:
            scaled_pixmap = pixmap.scaled(
                self.width(), self.height(), QtCore.Qt.KeepAspectRatio)
            self.image_label.setPixmap(scaled_pixmap)
            label_x = (self.width() - scaled_pixmap.width()) // 2
            label_y = (self.height() - scaled_pixmap.height()) // 2
            self.image_label.setGeometry(
                label_x, label_y, scaled_pixmap.width(), scaled_pixmap.height())

    def start_animation(self):
        # Just show the overlay without raising or activating it
        self.show()
        # Do not call self.raise_() or self.activateWindow() since that would focus the window
        self.animation_group.start()

    def hide_after_animation(self):
        """Hide the overlay after the animation completes."""
        self.hide()
        print("Animation complete. Overlay hidden.")

    def closeEvent(self, event):
        """Override close event to minimize to tray."""
        self.hide()
        event.ignore()


class GameServer:
    def __init__(self, overlay_widget=None):
        self.app = Flask(__name__)
        self.clock_time = 0
        self.seconds = 0
        self.minutes = 0
        self.running = True  # Flag to control the threads

        # Overlay widget reference
        self.overlay_widget = overlay_widget

        # Initialize thread for processing data
        self.data_processing_thread = threading.Thread(
            target=self.process_data, daemon=True
        )

        # Register Flask routes (move this after defining handle_post)
        self.app.add_url_rule('/', 'handle_post',
                              self.handle_post, methods=['POST'])

    def handle_post(self):
        """Handle incoming POST requests from Flask."""
        data = request.get_json()
        if data and 'map' in data and 'clock_time' in data['map']:
            self.clock_time = data['map']['clock_time']
            if self.clock_time >= 0:
                self.seconds = self.clock_time % 60
                self.minutes = self.clock_time // 60
                return str(self.clock_time)
        return "OK"

    def start_threads(self):
        # Start the Flask app in a thread
        flask_thread = threading.Thread(target=self.run)
        flask_thread.daemon = True  # Allow Flask thread to exit with the main program
        flask_thread.start()

        # Start the data processing thread
        self.data_processing_thread.start()

    def process_data(self):
        """Handle game data processing logic."""
        last_minute = 0
        while self.running:  # Check the running flag
            with threading.Lock():
                minutes_copy = self.minutes
                seconds_copy = self.seconds

            # Add your processing logic here (e.g., checking for specific events)
            if (minutes_copy == 6 and seconds_copy == 30) or (minutes_copy > 6 and (minutes_copy - 6) % 7 == 0 and seconds_copy == 30):
                if self.overlay_widget:
                    self.overlay_widget.signal_update_image.emit(
                        "EXPRUNE_IMAGE")
                    self.overlay_widget.signal_start_animation.emit()

            if seconds_copy == 45 and not minutes_copy == 0:
                if self.overlay_widget:
                    self.overlay_widget.signal_update_image.emit("STACK_IMAGE")
                    self.overlay_widget.signal_start_animation.emit()

            if seconds_copy > 0 and minutes_copy > 0 and last_minute != minutes_copy:
                if find_template_on_screen():
                    addToClipBoard(f"{minutes_copy:02}{seconds_copy:02}")
                    last_minute = minutes_copy

            time.sleep(1)  # Sleep to limit CPU usage

    def run(self):
        """Run the Flask server."""
        log = logging.getLogger('werkzeug')
        log.setLevel(logging.ERROR)
        self.app.run(port=3000)

    def stop(self):
        """Stop threads gracefully."""
        self.running = False
        self.data_processing_thread.join()


if __name__ == '__main__':
    app = QApplication(sys.argv)
    overlay_pulse = Overlay_pulse()
    server = GameServer(overlay_pulse)

    # Start the server and other threads
    server.start_threads()

    # Create the tray application
    tray_app = TrayApp(overlay_pulse, server, app)

    # Run the application event loop
    sys.exit(app.exec_())
